import "./App.css";
import Cards from "./Cards";
import "./Navbar";
import Navbar from "./Navbar";
import Sidebar from "./sidebar";
function App() {
  return (
    <div class="container">
      <div class="container_right_side">
        <Cards />
        <Navbar />
        <Sidebar />
      </div>
    </div>
  );
}

export default App;
